        FORTNITE_GIFT_INVENTORY_INFO:
          "Assortis ton \xe9quipement \xe0 ton {guardOutfitName}!\n\n\xc0 partir du 4\xa0mai, d\xe9verrouille le Drop Discord {rewardName} en effectuant l'une de ces deux actions\xa0:\n\nStreame Fortnite en direct et fais un partage d'\xe9cran sur Discord pendant 15+\xa0minutes pour au moins un ami Discord.\n\nApr\xe8s 15\xa0minutes de partage d'\xe9cran avec un ami, tu recevras un lien en cadeau dans tes Param\xe8tres > Inventaire des cadeaux.\n\nClique sur le lien pour te connecter \xe0 ton compte Epic Games et le rev\xeatement sera ajout\xe9 \xe0 ton Casier Fortnite\xa0!\n\nTu ne peux pas streamer\xa0? Tu peux aussi accepter la qu\xeate du bot Discord\xa0! Commence par rejoindre le [serveur Discord officiel de Fortnite](http://discord.gg/fortnite).\n\nSur ce serveur, tu verras un bot avec lequel tu peux interagir pour rejoindre la qu\xeate Discord.\n\nEn interagissant avec le bot, tu acc\xe8deras \xe0 une page qui te permettra de lier tes comptes Epic et Discord.\n\n\xc0 l'aide de tes comptes li\xe9s, participe \xe0 la qu\xeate en terminant une t\xe2che sur Discord et une t\xe2che sur Fortnite.\n\nApr\xe8s avoir termin\xe9 ces deux t\xe2ches, le rev\xeatement sera ajout\xe9 \xe0 ton Casier Fortnite\xa0!\n\nPour en savoir plus, tu peux jeter un œil \xe0 notre article de blog\xa0!\n",
